def get_ngos_by_pincode(pincode):
    """
    Returns a list of NGOs for the given PIN code.
    If the PIN code is not found, returns NGOs from a nearby area or an empty list.
    
    Args:
        pincode (str): A 6-digit Indian PIN code
        
    Returns:
        list: A list of NGO dictionaries with their details
    """
    # Check if the exact PIN code exists in our database
    if pincode in NGO_DATABASE:
        return NGO_DATABASE[pincode]
    
    # If not found, try to find NGOs in a similar area (first 2 digits of PIN code)
    area_prefix = pincode[:2]
    for pin in NGO_DATABASE:
        if pin.startswith(area_prefix):
            return NGO_DATABASE[pin]
    
    # If still not found, return an empty list
    return []
